script: |
  super -f text -I q5408.spq | sort > q5408.out

inputs:
  - name: q5408.spq
    data: |
      SELECT DISTINCT - ( + col1 ) AS col0, ( - + 86 ) AS col2 FROM tab0 (FORMAT parquet) WHERE NOT - col2 IS NULL;
  - name: tab0

outputs:
  - name: q5408.out
    data: |
      -1	-86
      -21	-86
      -81	-86
